const img=document.querySelector(".profile img");const images=["assets/channels4_profile.webp","assets/profile.webp","assets/35_n.webp","assets/27_n.webp","assets/112_n.webp","assets/295_n.webp","assets/612_n.webp"];const preloadImages=images.map(image=>{const img=new Image;img.src=image;return img});let i=1;function cambiarImagen(){img.style.opacity=0;setTimeout(()=>{img.src=images[i];img.style.opacity=1;i++;if(i>=images.length){i=0}},750)}async function waitForImagesToLoad(){await Promise.all(preloadImages.map(img=>{if(img.complete)return Promise.resolve();return new Promise(resolve=>{img.onload=resolve})}))}waitForImagesToLoad().then(()=>{setInterval(cambiarImagen,5e3)});